import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import moment from "moment";
import {
  Table,
  TableHead,
  TableBody,
  TableRow,
  TableCell,
  Typography,
} from "@material-ui/core";
import * as actions from "./../../../../../../Actions";

export default function TaskUsers() {
  const users = useSelector((state) => state.users);
  const dispatch = useDispatch();
  const now = new moment();

  const checkUsers = (users) => {
    var result = null;
    var count = 0;

    users.map((user, index) => {
      if (moment(user.date).fromNow().indexOf("hours ago") !== -1) {
        count++;
      }
    });

    count === 0 ? (result = false) : (result = true);
    return result;
  };

  useEffect(() => {
    dispatch(actions.acGetUsersRequest());
  }, []);

  return (
    <Table>
      <TableHead>
        <TableRow>
          <TableCell>ID</TableCell>
          <TableCell>Email</TableCell>
          <TableCell>Username</TableCell>
          <TableCell>Date</TableCell>
        </TableRow>
      </TableHead>
      <TableBody>
        {checkUsers(users) ? (
          users.map((user, index) => {
            if (moment(user.date).fromNow().indexOf("hours ago") !== -1) {
              return (
                <TableRow key={index}>
                  <TableCell>{user.id}</TableCell>
                  <TableCell>{user.email}</TableCell>
                  <TableCell>{user.username}</TableCell>
                  <TableCell>{user.date}</TableCell>
                </TableRow>
              );
            }
          })
        ) : (
          <TableRow>
            <TableCell colSpan={4}>
              No users have registered within the last 24 hours
            </TableCell>
          </TableRow>
        )}
      </TableBody>
    </Table>
  );
}
